import { enumStatus, enumTypes, exchangedType } from "@configs";

export interface IReward {
    exchangedType?: exchangedType,
    updatedAtHistory:Date|string,
    idCart?: string,
    _id?: string;
    point?: number;
    levelIds?: string[];
    status: enumStatus;
    name: string;
    quantity?: number;
    limit?: number;
    imageUrl: string[];
    description: string;
    startDate: string | Date;
    endDate: string | Date;
    code: string;
    birthMonths?: string[];
    variants: IVariant[];
    createdAt?: string;
    updatedAt?: string;
    type?:enumTypes;
}

export interface IVariant {
    _id?: string;
    name: string;
}

export interface IDataReward {
    point: number;
    reward: IReward[];
}
